import { Route, Routes } from "react-router-dom";
import Loading from "./Loading.js";
function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Loading />} />
            </Routes>
        </BrowserRouter>
    );
}

export default App;
